import React from 'react';

const CarImage = ({ className = '', style = {} }) => {
  return (
    <div 
      className={`d-flex justify-content-center align-items-center ${className}`}
      style={{
        minWidth: '300px',
        maxWidth: '800px',
        width: '100%',
        backgroundColor: '#1b87f978',
        ...style
      }}
    >
      <img 
        src="https://dashboard.codeparrot.ai/api/image/Z7kBNVCHtJJZ6v_o/audi-1.png"
        alt="Audi Car"
        className="img-fluid"
        style={{
          width: '100%',
          height: 'auto',
          maxHeight: '360px',
          objectFit: 'contain',
          zIndex: 2
        }}
      />
    </div>
  );
};

export default CarImage;
